import { Container, Row, Col, Image, Button } from 'react-bootstrap';
import img1 from '../img/img.jpg';


const Service1 = () => {
  return (
    <Container fluid>
      <Row className="align-items-center">
        {/* Imagen en la izquierda para desktop */}
        <Col lg={6} className="order-lg-1">
          <Image src={img1} fluid />
        </Col>

        {/* Contenido en la derecha */}
        <Col lg={6} className="order-lg-2">
          <div>
            <h2>Título</h2>
            <p>Subtítulo</p>
            <Button variant="primary">Botón</Button>
          </div>
        </Col>

        {/* Imagen arriba para móvil */}
        <Col xs={12} className="order-lg-1">
          <Image src="ruta-de-tu-imagen" fluid />
        </Col>
      </Row>
    </Container>
  );
};

export default Service1;
